        }

        /// <summary>Returns the result of specified shuffling of the components from two U32x2 vectors into a U32x3 vector.</summary>
        /// <param name="left">U32x2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">U32x2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting U32x3 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting U32x3 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting U32x3 z component.</param>
        /// <returns>U32x3 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static U32x3 shuffle(U32x2 left, U32x2 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z)
        {
            return new U32x3(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z));
        }

        /// <summary>Returns the result of specified shuffling of the components from two U32x2 vectors into a U32x4 vector.</summary>
        /// <param name="left">U32x2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">U32x2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting U32x4 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting U32x4 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting U32x4 z component.</param>
        /// <param name="w">The ShuffleComponent to use when setting the resulting U32x4 w component.</param>
        /// <returns>U32x4 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static U32x4 shuffle(U32x2 left, U32x2 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return new U32x4(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z),
                select_shuffle_component(left, right, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static uint select_shuffle_component(U32x2 a, U32x2 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + component);
            }
        }

    }
}
